import '../css/Footer.css'

const Footer = () => (<footer class='main-footer'>
    <p class='main-footer__line1'>powered by React</p>
    <p class='main-footer__line2'>made by Kyrylo Zarytskyi</p>
  </footer>
);

export default Footer;
